if (!window.frappe) window.frappe = {};

frappe.provide = function (namespace) {
	var nsl = namespace.split('.');
	var parent = window;
	for (var i = 0; i < nsl.length; i++) {
		var n = nsl[i];
		if (!parent[n]) {
			parent[n] = {};
		}
		parent = parent[n];
	}
	return parent;
};

